import "./App.css";
import denverpic from "./assets/img/DenverJam_poster.png";

function App() {
  return (
    <div className="App">
      <div className="headercontainer">
        <img className="mainpic" src={denverpic}></img>
      </div>
      <div className="maincontainer">
        <div></div>
      </div>
    </div>
  );
}

export default App;
